-- Configuration / may change
local ConcealedStorageHeight = 3.0
local ConceiledStorageOffset = -10000.0

local ChimeraExtAvailable = true;
local ChimeraObjExtA = nil;
local ChimeraObjExtB = nil;

local ChimeraExtAState = true;
local ChimeraExtBState = false;

function onSave()
    local saveObj = {chimeraExtA=ChimeraExtAState,chimeraExtB=ChimeraExtBState};
	
    return JSON.encode( saveObj );
end

--Runs when game is loaded.
function onLoad( saveData )
	self.interactable = false;
	
    if saveData ~= "" then
        local saveObj = JSON.decode( saveData );
		ChimeraExtAState = saveObj.chimeraExtA;
		ChimeraExtBState = saveObj.chimeraExtB;
    end
	
	ChimeraObjExtA = GetObjectByName( "ChimeraExtensionA" );
	ChimeraObjExtB = GetObjectByName( "ChimeraExtensionB" );
	
	if( ChimeraObjExtA == nil or ChimeraObjExtB == nil ) then
		printToAll( "Chimera Extension Widget disabled: unable to find object name(s) 'ChimeraExtensionA' and/or 'ChimeraExtensionB'.", {0.8, 0.0, 0.0, 1.0} );
		ChimeraExtAvailable = false;
		UI.setAttribute( "chimeraWidget", "active", false );
	else
		if ChimeraExtAState == false then
			ChimeraExtAOff();
		else
			ChimeraExtAOn();
		end
		
		if ChimeraExtBState == true then
			ChimeraExtBOn();
		else
			ChimeraExtBOff();
		end
		
	end
end

function onChat( message, player )
	if player.host then
		if message == "chimeralock" then
			self.interactable = not self.interactable;
			
			if self.interactable then
				printToColor( "Table can now be edited.", player.color, {r=0, g=1, b=0} );
			else
				printToColor( "Table is now safe from editing.", player.color, {r=0, g=1, b=0} );
			end
		end
	end
end

function GetObjectByName( name )
    for k,v in pairs( getAllObjects() ) do
		if( v.getName() == name ) then
			return v;
		end
    end
end

function Store( obj )
	local bounds = obj.getBounds()
	
	bounds.center.y = bounds.center.y + 5.0;
	bounds.size.y = bounds.size.y + 5.0;
	
	local found = Physics.cast({
		origin = bounds.center,
		direction = {0, 1, 0},
		type = 3,
		size = bounds.size,
		max_distance = 0,
		debug = false
	});
	
    for k,v in pairs( found ) do
		if v.hit_object ~= obj then
			Hide( v.hit_object );
		end
    end
	
	Hide( obj );
end

function Dispense( obj )
	local bounds = obj.getBounds();
	
	bounds.center.y = bounds.center.y + 5.0;
	bounds.size.y = bounds.size.y + 5.0;
	
	local found = Physics.cast({
		origin = bounds.center,
		direction = {0, 1, 0},
		type = 3,
		size = bounds.size,
		max_distance = 0,
		debug = false
	});
	
	Show( obj );
	
    for k,v in pairs( found ) do
		if v.hit_object ~= obj then
			Show( v.hit_object );
		end
    end
end

function Hide( obj )
	local pos = obj.getPosition();
	
	if pos.y < ConceiledStorageOffset + 1000 then
		return;
	end
	
    obj.setPosition({
       x = pos.x,
       y = pos.y + ConceiledStorageOffset,
       z = pos.z
    });
end

function Show( obj )
	local pos = obj.getPosition();
	
	if pos.y > ConceiledStorageOffset + 1000 then
		return;
	end
	
	obj.setPosition({
		x = pos.x,
		y = pos.y - ConceiledStorageOffset,
		z = pos.z
	});
	
end

---
--- Widget functionality
---
function ChimeraExtAOn()
	ChimeraExtAState = true;
	ChimeraExtRender();
	
	UI.setAttribute( "chimeraWidgetExtAOn", "active", true );
	UI.setAttribute( "chimeraWidgetExtAOff", "active", false );
	
	Dispense( ChimeraObjExtA );
end

function ChimeraExtAOff()
	ChimeraExtAState = false;
	ChimeraExtRender();
	
	UI.setAttribute( "chimeraWidgetExtAOn", "active", false );
	UI.setAttribute( "chimeraWidgetExtAOff", "active", true );
	
	Store( ChimeraObjExtA );
end

function ChimeraExtBOn()
	ChimeraExtBState = true;
	ChimeraExtRender();
	UI.setAttribute( "chimeraWidgetExtBOn", "active", true );
	UI.setAttribute( "chimeraWidgetExtBOff", "active", false );
	
	Dispense( ChimeraObjExtB );
end

function ChimeraExtBOff()
	ChimeraExtBState = false;
	ChimeraExtRender();
	UI.setAttribute( "chimeraWidgetExtBOn", "active", false );
	UI.setAttribute( "chimeraWidgetExtBOff", "active", true );
	
	Store( ChimeraObjExtB );
end

function ChimeraExtRender()
	UI.setAttribute( "ui_x_x", "active", (not ChimeraExtAState and not ChimeraExtBState) );
	UI.setAttribute( "ui_a_x", "active", (ChimeraExtAState and not ChimeraExtBState) );
	UI.setAttribute( "ui_x_b", "active", (not ChimeraExtAState and ChimeraExtBState) );
	UI.setAttribute( "ui_a_b", "active", (ChimeraExtAState and ChimeraExtBState) );
end

